import React, { useEffect } from "react";

function Home() {
  useEffect(() => {
    console.log("✅ Home page loaded successfully!");
  }, []);

  return (
    <div>
      <h1>Welcome to the Behavioral Analysis System</h1>
      <p>Monitor user behavior and detect anomalies using AI.</p>
    </div>
  );
}

export default Home;

